  'appendChild', 
  'removeChild',
  'Cannot deserialize',
  'JSON parse error',
  'NotFoundError',
  'Node',
  'commitPlacement',
  'commitMutationEffects',
  'ReactDOM.render',
  'bundle.js'
];

// Function to check if error should be suppressed
const shouldSuppressError = (message) => {
  if (!message || typeof message !== 'string') return false;
  return DOM_ERROR_KEYWORDS.some(keyword => message.includes(keyword));
};

