const originalConsoleError = console.error;
console.error = (...args) => {
  const message = args.join(' ');
  if (shouldSuppressError(message)) {
    console.warn('üîá [SUPPRESSED] DOM error:', message);
    return; // Do not log to console
  }
  originalConsoleError(...args);
};

// 2. OVERRIDE console.warn for additional suppression
const originalConsoleWarn = console.warn;
console.warn = (...args) => {
  const message = args.join(' ');
  if (shouldSuppressError(message)) {
    console.debug('üîá [SUPPRESSED] DOM warning:', message);
    return; // Do not log to console
  }
  originalConsoleWarn(...args);
};

// 3. Global window error handler
window.addEventListener('error', (event) => {
  if (event.error && event.error.message) {
    const message = event.error.message;
    if (shouldSuppressError(message)) {
      console.debug('üõ°Ô∏è [SUPPRESSED] Global DOM error:', message);
      event.preventDefault();
      event.stopPropagation();
      event.stopImmediatePropagation();
      return false;
    }
  }

  // Also check event.message
  if (event.message && shouldSuppressError(event.message)) {
    console.debug('üõ°Ô∏è [SUPPRESSED] Global DOM error message:', event.message);
    event.preventDefault();
    event.stopPropagation();
    event.stopImmediatePropagation();
    return false;
  }
}, true);

// 4. Promise rejection handler
window.addEventListener('unhandledrejection', (event) => {
  if (event.reason) {
    let message = '';
    if (typeof event.reason === 'string') {
      message = event.reason;
    } else if (event.reason.message) {
      message = event.reason.message;
    } else if (event.reason.toString) {
      message = event.reason.toString();
    }

    if (shouldSuppressError(message)) {
      console.debug('üõ°Ô∏è [SUPPRESSED] Promise rejection DOM error:', message);
      event.preventDefault();
      return false;
    }
  }
}, true);

// 5. React Error suppression in QueryClient
const queryClient = new QueryClient({
  defaultOptions: {
    queries: {
      retry: 1,
      refetchOnWindowFocus: false,
      staleTime: 5 * 60 * 1000,
      cacheTime: 10 * 60 * 1000,
      onError: (error) => {
        if (error && error.message && shouldSuppressError(error.message)) {
          console.debug('üõ°Ô∏è [SUPPRESSED] Query DOM error:', error.message);
          return;
        }
      }
    },
    mutations: {
      onError: (error) => {
        if (error && error.message && shouldSuppressError(error.message)) {
          console.debug('üõ°Ô∏è [SUPPRESSED] Mutation DOM error:', error.message);
          return;
        }
      }
    }
  },
});

// 6. Override React error logging
const originalReactError = window.__REACT_DEVTOOLS_GLOBAL_HOOK__?.onCommitFiberRoot;
if (originalReactError) {
