    } catch (error) {
      if (error && error.message && shouldSuppressError(error.message)) {
        console.debug('üõ°Ô∏è [SUPPRESSED] React DevTools DOM error:', error.message);
        return;
      }
      throw error;
    }
  };
}

// 7. Suppress any remaining DOM errors from React internals
const originalCreateElement = React.createElement;
React.createElement = function(...args) {
  try {
    return originalCreateElement.apply(this, args);
  } catch (error) {
    if (error && error.message && shouldSuppressError(error.message)) {
      console.debug('üõ°Ô∏è [SUPPRESSED] React createElement DOM error:', error.message);
      return null; // Return null element instead of crashing
    }
    throw error;
  }
};

// 8. Create root with error suppression
const root = ReactDOM.createRoot(document.getElementById('root'));

// Render app with multiple error boundaries
root.render(
  <UltraErrorBoundary>
    <QueryClientProvider client={queryClient}>
      <UltraErrorBoundary>
        <BrowserRouter>
          <UltraErrorBoundary>
            <AuthProvider>
              <UltraErrorBoundary>
                <App />
              </UltraErrorBoundary>
